import React, {memo} from 'react';
import styled from 'styled-components';

import Title from '../../components/TitleContainer';

const FDetailPagesContainer = styled.div`
    width:100%;

    .contentContainer{
        max-width:1200px;
        margin: 0 auto;

        .formTable{
            width:100%;

            tbody{
                border-top:2px solid #333333;

                tr{
                    height: auto;
                    line-height: 1.3;
                    border-bottom:1px solid #D9D9D9;

                    .row{
                        padding:20px;
                        vertical-align: middle;
                    }

                    td{
                        padding:20px;
                        vertical-align: middle;
                    }
                }
            }
        }
    }

`;

const FDetailPages = memo(() => {
    return (
        <FDetailPagesContainer>
            <Title title='창업지원' txt='당신의 빛나는 미래 사업을 응원합니다.' />
            <div className='contentContainer'>
                <table className='formTable'>
                    <colgroup>
                        <col style={{width:"12%", backgroundColor:"#f5f5f5"}}></col>
                        <col style={{width:"38%"}}></col>
                        <col style={{width:"12%", backgroundColor:"#f5f5f5"}}></col>
                        <col style={{width:"38%"}}></col>
                    </colgroup>
                    <tbody>
                        <tr>
                            <th className='row'>연령</th>
                            <td>연령</td>
                            <th className='row'>취업 상태</th>
                            <td>취업상태</td>
                        </tr>
                        <tr>
                            <th className='row'>학력/전공</th>
                            <td colSpan={3}>무관</td>
                        </tr>
                        <tr>
                            <th className='row'>거주지 및 소득</th>
                            <td colSpan={3}>
                            </td>
                        </tr>
                    </tbody>
                </table>
            </div>
            
        </FDetailPagesContainer>
    );
});

export default FDetailPages;
